import React, { FC } from 'react';
import { PcaWrapper } from './pca.styled';

interface CarProps {
   car: {
      comments: string[];
      digits: string;
      is_stolen: boolean;
      model: string;
      model_year: number;
      operations: Array<any>;
      photo_url: string;
      region: {
        name: string;
        name_ua: string;
        slug: string;
        old_code: string;
        new_code: string;
      };
      stolen_details: any;
      vendor: string;
      vin: string;
    } | null | undefined;
}

const Pca: FC<CarProps> = ({ car }) => (
  <PcaWrapper>
    hello {car.model} {car.model_year}
  </PcaWrapper>
);

export default Pca;
